import React, { Component,Fragment } from 'react'
import { Navbar, Nav} from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import { BrowserRouter ,Route, Link } from 'react-router-dom';
import LOGO from './img/LOGO.png';


import Beranda from './Beranda';
import Toko from './Toko';
import Aktivitas from './Aktivitas';
import About from './About';

class NavbarComp extends Component {
  render() {
    return (
      
      <Fragment>
        <div>
            <Navbar collapseOnSelect expand="lg" bg="success" variant="dark">
            <Container>
                <Navbar.Brand className='fw-bold' href="#home"><img className='mx-1' src={LOGO} width={40} height={40} alt='logo' />TernakSignature</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                  <Nav className="me-auto">
                  </Nav>
                  <Nav>
                      <Link  href='/beranda'>Beranda</Link>
                      <Link as={Link} to="/toko">Toko</Link>
                      <Nav.Link as={Link} to="/aktivitas" >Aktivitas</Nav.Link>
                      <Link as={Link} to="/about">About Us</Link>
                  </Nav>
                </Navbar.Collapse>
            </Container>
            </Navbar>
          </div>
      </Fragment>
      

      
      
        
      
      
      
    )
  }
}

export default NavbarComp;
